class Test(unittest.TestCase):
	def test_unit_internal(self):
		encoded = RawTransaction._encodeVarInt(298)
		newPos, value = RawTransaction._decodeVarInt(encoded, 0)
		assert newPos == len(encoded)
		assert value == 298

