	def test_bad_transaction_detection(self):
		# start with a 'good' transaction
		# (but note that control address prefix changed since this transaction)
		txHex = ''
		txBytes = RawTransaction.FromHex(txHex)
		self.assertFalse(RawTransaction.UnexpectedFormat_Fast(txBytes, b''))
		self.assertFalse(RawTransaction.UnexpectedFormat_Fast(txBytes, b'SWB'))
		decoded, decodedScriptPubKeys = RawTransaction.Decode(txBytes)
		self.assertEqual(decoded.outputPubKeyHash(0), b'SWB\x02\x15\xcd[\x07\x00\x00\xff\xff\xff\xff\xcc\xcc\xccL\x00\x00')
		# change version
		alteredHex = '02000000' + txHex[8:]
		txBytes = RawTransaction.FromHex(alteredHex)
		self.assertTrue(RawTransaction.UnexpectedFormat_Fast(txBytes, b''))
		self.assertTrue(RawTransaction.UnexpectedFormat_Fast(txBytes, b'SWB'))
		# check all version bytes actually checked
		alteredHex = '01000001' + txHex[8:]
		txBytes = RawTransaction.FromHex(alteredHex)
		self.assertTrue(RawTransaction.UnexpectedFormat_Fast(txBytes, b''))
		self.assertTrue(RawTransaction.UnexpectedFormat_Fast(txBytes, b'SWB'))
		# truncate tx data
		shortenedTXHex = txHex[:-10]
		txBytes = RawTransaction.FromHex(shortenedTXHex)
		self.assertTrue(RawTransaction.UnexpectedFormat_Fast(txBytes, b''))
		self.assertTrue(RawTransaction.UnexpectedFormat_Fast(txBytes, b'SWB'))
		# truncate tx data by just one byte
		shortenedTXHex = txHex[:-2]
		txBytes = RawTransaction.FromHex(shortenedTXHex)
		self.assertTrue(RawTransaction.UnexpectedFormat_Fast(txBytes, b''))
		self.assertTrue(RawTransaction.UnexpectedFormat_Fast(txBytes, b'SWB'))

